import "./App.css";
import React, { useState } from "react";

function App() {
  const [forsinkelser, setForsinkelser] = useState([]);

  async function test() {
    fetch("http://localhost:3001/forsinkelser")
      .then((res) => res.json())
      .then((data) => {
        const forsinkelser = data.map((forsinkelse) => {
          forsinkelse.aimedTime = new Date(forsinkelse.aimedTime);
          return forsinkelse;
        });
        setForsinkelser(data);
      });
  }

  return (
    <div className="App">
      <button onClick={test}>TEST</button>
      {forsinkelser.map((forsinkelse) => (
        <div className="forsinkelseBox" key={forsinkelse.id + {} + forsinkelse.aimedTime}>
          <p className="lineBox">
            Line: <span>{forsinkelse.line} </span>
            <span>{forsinkelse.name}</span>
          </p>
          <p className="aimedBox">Aimed Time: {forsinkelse.aimedTime}</p>
          <p className="expectedBox">Expected Time: {forsinkelse.expectedTime}</p>
        </div>
      ))}
    </div>
  );
}

export default App;
